import React, { useState } from "react";
import Chart from "react-apexcharts";

const Doughnut = () => {
  const [dataSeries, setdataSeries] = useState([30, 40, 70, 110]);
  const [option, setOption] = useState<any>({
    legend: {
      show: false,
    },

    title: {
      text: "title",
      style: {
        fontSize: "14px",
        fontWeight: "bold",
        fontFamily: "Bukra",
        color: "red",
      },
    },
    yaxis: {
      forceNiceScale: true,
    },
  });
  return (
    <div>
      <Chart options={option} series={dataSeries} type="donut" width={400} />
    </div>
  );
};

export default Doughnut;
